<h3>O fim da era Ron Dennis</h3>
<p>Na mesma época em que Ron Dennis estava sendo acusado de se envolver em diversos escândalos, decidiu se aposentar. Em 2009 ele foi substituído por Martin Withmarsh.</p>
<p>Neste ano, a equipe não fez um bom começo de temporada, foi se recuperando durante o ano e conseguiu terminar o campeonato em 3º lugar. Não é um resultado final desejado, porém, ter feito mais pontos que a Ferrari, para eles, é um consolo. O mesmo foi em 2010.</p>
<p>Desde 2010, a equipe é a única que tem em seu time dois pilotos campeões mundiais, Hamilton e Button.</p>
<p>Neste mesmo ano, a Mercedes entrou na Fórmula 1 com equipe própria. Dizia-se muito que isso prejudicaria a McLaren, por usarem motores Mercedes. Mas pelo menos nos dois primeiros anos, o time foi superior ao da Mercedes.</p>
<p>Visto que a McLaren também é uma montadora de carros esportivos, a direção estuda a possibilidade de romper de vez sua relação com a Mercedes e fabricar seus próprios motores independentes. Pode ser uma");
                WriteLiteral(@" ideia lucrativa, porém, fabricar motores do ""zero"", não é algo tão simples.</p>
<p>Por enquanto, os motores serão fornecidos pela Mercedes até 2014 e a partir de 2015 a Honda voltará a fornecer motores o time.</p>
<p>Assim, em 45 anos de história na Fórmula 1, a McLaren ganhou 173 corridas, cravou 146 pole positions, subiu 326 vezes ao pódio, acumulou mais de 2.500 pontos e cerca de 40 pilotos de várias nacionalidades se revezaram nos cockpits de seus carros.</p>
<p>A primeira prova disputada pela McLaren foi em 1966. Foi seu fundador Bruce McLaren quem conduziu o carro à primeira vitória, em Spa-Francorchamps, dois anos depois.</p>
<p>O piloto que mais disputou provas pela equipe foi o finlandês Mika Hakkinen, com 116. O maior vencedor foi o brasileiro Ayrton Senna, com 35 vitórias, e o corredor que mais vezes subiu ao pódio foi o francês Alain Prost, que esteve nos degraus 63 vezes.</p>

<h3>A McLaren atualmente</h3>

<p>Mesmo dando um ótimo carro para Jenson Button que permitiu ele fechar o ano em");
                WriteLiteral(@" 2011 como vice-campeão, além de algumas vitórias de ambos os pilotos em anos recentes, o time em 2013 atravessa uma das piores fases de sua história recente. Aparentemente a contratação de Sergio Perez, não foi uma boa escolha.</p>
<p>A temporada 2015 foi marcada pela volta da parceria McLaren Honda e também o retorno de Fernando Alonso ao time. A fase da equipe por enquanto pode ser considerada a pior de história!</p>

